async def send_post_request(session, url, data, request_number):
    try:
        start_time = time.time()
        async with session.post(url, data={"data": data}) as response:
            response.raise_for_status()
            end_time = time.time()

            elapsed_time = end_time - start_time
            print(f"Request {request_number} sent successfully. Status code: {response.status}. Time: {elapsed_time:.2f} seconds")
    except aiohttp.ClientError as e:
        print(f"Error sending request {request_number}: {e}")

